import React, { useState, useRef } from 'react';
import { Link } from 'react-router-dom';

const DashboardPage: React.FC = () => {
  const [isDragging, setIsDragging] = useState(false);
  const [selectedFiles, setSelectedFiles] = useState<File[]>([]);
  const fileInputRef = useRef<HTMLInputElement>(null);

  const handleDragEnter = (e: React.DragEvent) => {
    e.preventDefault();
    e.stopPropagation();
    setIsDragging(true);
  };

  const handleDragLeave = (e: React.DragEvent) => {
    e.preventDefault();
    e.stopPropagation();
    setIsDragging(false);
  };

  const handleDrop = (e: React.DragEvent) => {
    e.preventDefault();
    e.stopPropagation();
    setIsDragging(false);

    const files = Array.from(e.dataTransfer.files);
    handleFiles(files);
  };

  const handleFileInput = (e: React.ChangeEvent<HTMLInputElement>) => {
    if (e.target.files) {
      const files = Array.from(e.target.files);
      handleFiles(files);
    }
  };

  const handleFiles = (files: File[]) => {
    const imageFiles = files.filter(file => file.type.startsWith('image/'));
    const newFiles = imageFiles.slice(0, 4 - selectedFiles.length);
    setSelectedFiles(prev => [...prev, ...newFiles].slice(0, 4));
  };

  const removeFile = (index: number) => {
    setSelectedFiles(prev => prev.filter((_, i) => i !== index));
  };

  const handleUpload = () => {
    // TODO: Implement actual upload logic
    console.log('Uploading files:', selectedFiles);
  };

  return (
    <div className="min-h-screen bg-[#0a0a0a] p-4 sm:p-6 md:p-8">
      {/* Header */}
      <div className="max-w-7xl mx-auto">
        <div className="flex justify-between items-center mb-8">
          <Link 
            to="/"
            className="text-[#00d9ff] hover:text-white transition-colors duration-300"
          >
            ← Back to Home
          </Link>
          <h1 className="text-2xl sm:text-3xl md:text-4xl font-bold text-white">
            My Dashboard
          </h1>
          <div className="w-20"></div> {/* Spacer for alignment */}
        </div>

        {/* Upload Area */}
        <div className="max-w-3xl mx-auto">
          <div 
            className={`
              relative rounded-xl border-2 border-dashed 
              ${isDragging ? 'border-[#00d9ff] bg-[rgba(0,217,255,0.1)]' : 'border-gray-600 hover:border-[#00d9ff]'}
              transition-all duration-300 
              p-6 sm:p-8 md:p-10
              text-center
            `}
            onDragEnter={handleDragEnter}
            onDragOver={handleDragEnter}
            onDragLeave={handleDragLeave}
            onDrop={handleDrop}
          >
            <input
              type="file"
              ref={fileInputRef}
              onChange={handleFileInput}
              multiple
              accept="image/*"
              className="hidden"
            />

            <div className="space-y-4">
              <div className="text-4xl sm:text-5xl md:text-6xl mb-4">📸</div>
              <h3 className="text-xl sm:text-2xl font-semibold text-white mb-2">
                Upload Your Images
              </h3>
              <p className="text-gray-400 mb-4 max-w-md mx-auto">
                Drag and drop your images here, or click to select files.
                You can upload up to 4 images.
              </p>
              <button
                onClick={() => fileInputRef.current?.click()}
                className="px-6 py-3 rounded-lg bg-[rgba(20,20,23,0.95)] 
                          border-2 border-[#00d9ff] text-[#00d9ff] font-medium
                          hover:shadow-[0_0_20px_rgba(0,217,255,0.5)] 
                          hover:bg-[rgba(0,217,255,0.1)]
                          transition-all duration-300"
              >
                Select Files
              </button>
            </div>
          </div>

          {/* Selected Files Preview */}
          {selectedFiles.length > 0 && (
            <div className="mt-8 space-y-6">
              <div className="grid grid-cols-1 sm:grid-cols-2 gap-4">
                {selectedFiles.map((file, index) => (
                  <div 
                    key={index}
                    className="relative group rounded-lg overflow-hidden
                             border-2 border-[#00d9ff] bg-[rgba(20,20,23,0.95)]"
                  >
                    <img 
                      src={URL.createObjectURL(file)}
                      alt={`Preview ${index + 1}`}
                      className="w-full h-48 object-cover"
                    />
                    <button
                      onClick={() => removeFile(index)}
                      className="absolute top-2 right-2 bg-black bg-opacity-50 
                                text-white rounded-full w-8 h-8 flex items-center 
                                justify-center opacity-0 group-hover:opacity-100
                                transition-opacity duration-300"
                    >
                      ×
                    </button>
                  </div>
                ))}
              </div>

              <div className="flex justify-center">
                <button
                  onClick={handleUpload}
                  className="px-8 py-4 rounded-lg bg-[#00d9ff] text-black font-bold
                            hover:shadow-[0_0_30px_rgba(0,217,255,0.7)]
                            transition-all duration-300
                            disabled:opacity-50 disabled:cursor-not-allowed"
                  disabled={selectedFiles.length === 0}
                >
                  Upload {selectedFiles.length} {selectedFiles.length === 1 ? 'Image' : 'Images'}
                </button>
              </div>
            </div>
          )}
        </div>
      </div>
    </div>
  );
};

export default DashboardPage;
